import React from "react";

const Something = () => {
  return (
    <main className="App-home">
      <div>Resources for Parents Caregivers</div>
      <div>FAQ Pokemon 101</div>
      <div>More about world of Pokemon - cards</div>
      <ul>
        <li>Pokemon Centers</li>
        <li>Pokemon Cafe</li>
        <li>Pokemon Trading Game</li>
        <li>Pokemon Shows, video games</li>
      </ul>
    </main>
  );
};

export default Something;
